import React from "react";

const TableBody = props => {
  //console.log(props);
  //console.log(Object.keys(props.data));
  return (
    <>
      <tbody>
        {props.data.map((it, index) => {
            console.log(it);
          return (
            <tr key={index}>
              <td>{it.title}</td>
              <td>{it.description}</td>
                <td></td>
            </tr>
          );
        })}
      </tbody>
    </>
  );
};

export default TableBody;
